window.jsPDF = window.jspdf.jsPDF;
function convert () {
    var doc = new jsPDF();

    doc.setFont("Roboto");
    doc.setFontSize(12);

    // Nb mins
    var mins = document.getElementById("mins").value;
    var arraymins = mins.split(",");
    var totalmin = arraymins.reduce(function(a, b) { return parseInt(a, 10) + parseInt(b, 10); }, 0);
    console.log("totalmin " + totalmin);


    
    //Nb heures en min
    var hrs = [];
    var hrs = document.getElementById("hours").value;
    var arrayhrs = JSON.parse("[" + hrs + "]");
    console.log("arrayhrs " + arrayhrs);
    final = hrs.split(",");
    final = final.reduce(function(a, b) { return parseInt(a, 10) + parseInt(b, 10); }, 0);
    mintohrs2 = Math.floor(totalmin/60)
    var remainingMinutes = totalmin % 60;
    
    var eur = 0.00
    //Calcul en argent
    var toeur = document.getElementById("paie").value
    if (remainingMinutes > 0) {
        remainingMinutes = 15
        eur += 2.25
    }
    if (remainingMinutes > 15) { 
        remainingMinutes = 30
        eur += 5
    }
    if (remainingMinutes > 30) { 
        remainingMinutes = 45
        eur += 7.25
    }
    if (remainingMinutes > 45) {
        remainingMinutes = 0
        eur += 10.00
    }
    var nbtotalheures = (final + mintohrs2) + "h" + remainingMinutes;
    eur += (final + mintohrs2) * toeur;
    
   

    // recupere les variables 

    var month = document.getElementById("month").value;
    var employeename = document.getElementById("name").value;
    var year = document.getElementById("year").value;
    

    //translate to pdf  

    var topdf = confirm("Voulez vous en faire un pdf ?");
    if (topdf) {
        let x = 15,
            y = 90,
            x1 = 110,
            y1 = 90;
        var imgData = 'data:image/jpgtèç_ripuypà_hùpoijvgfsdoihvfwsdùoifchwqsoufchywsùpifchu<wqsoufcdhyeg;base64,'
        
        doc.addImage(imgData, 'JPEG', 15, 10, 170, 30);
        doc.text(month + " " + year, 170,60);
        doc.text(employeename, 15, 60);
        doc.text("Voici les minutes : ", 35, 85);
        doc.text("Voici les heures : ", 125, 85);
        
        doc.line(100, 90, 100, 250);

        
        

        for (i = 0; i < arraymins.length; i++) {
            a = arraymins[i].toString();
            a.trim();
            let lastarraymins = [];
            lastarraymins.push(a);
            y += 10;

            if(y >= 250) { 
                y = 100; 
                x+= 20;

            }
            doc.text(lastarraymins + " min, ", x, y);
            
            
        }
       

        for( i = 0; i<arrayhrs.length; i++) { 
            a1 = arrayhrs[i].toString();
            a1.trim();
            let lastarrayhrs = []; 
            lastarrayhrs.push(a1);

            y1 += 10;

            if(y1 >= 250) { 
                y1 = 100; 
                x1+= 20;

        }
        doc.text(lastarrayhrs + " h, ", x1, y1);
        

    }
        doc.setTextColor(255,0,0)
        doc.text("Le total est de " + nbtotalheures, 40, 280);
        doc.setTextColor(0,55,200)
        doc.text("Cela fait : " + eur + "€", 120, 280);
        doc.save("heures_salarié " + employeename + " " +  month + year + ".pdf");
        
        

    } else {
        alert("Le total est de " + nbtotalheures);
        return;

    }  

}
